import Vue from 'vue';  // Importa Vue
import Home from './Home.vue';  // Importa el archivo Home.vue

Vue.config.productionTip = false;

new Vue({
  render: h => h(Home),  // Usa el componente Home
}).$mount('#app');  // Monta la aplicación en el elemento con id="app"
